Cast: Kelly Kline, Nikki Rhodes, Tiffany Price, Gianna Michaels, Gianna Lynn, Cassandra Cruz, Brianna Beach, Lexi Lamour, Heather Gables, Allaura Sweet

Description: These everyday housewives are a wee bit peckish for fresh meat, and their husbands wouldnt mind losing the ball and chain long enough to pork thy neighbors wife. At first the little ladies are shy, awkward, and reluctant, but faster than you can say ramrod reciprocation our connubial foxes are gobbling unfamiliar knobs and getting pounded by someone elses giddy, grateful hubby. See ten couples get their sloppy swap on.
